import React, { Component } from "react";
// import File from "./File";


class App extends Component {
    render() {
        return (
            <div>
                <File name="ali" name2="samad" />
                <File name="aly" name2="samadi" />
                <File name="alo" name2="samado" />
            </div>
        )
    }
}


export default App;
